import logo from './logo.svg';
import './App.css';
import headerBar from './headerBar';
import messageScreen from './messageScreen';
import Fragment from 'react';

function App() {
  const header = headerBar();
  const footerStuff = messageScreen();
  const appSpace = (
      <div className = "App">
      <React.Fragment>
        {  header }
        { footerStuff }
      </React.Fragment>
      </div>
    );

  return (
    appSpace
    );
  }

export default App;
